    const Auth = useContext(AuthContext);
    const handleForm = e => {
        e.preventDefault();
        console.log(Auth);
        Auth.setLoggedIn(true);
    };

    return (
        <form onSubmit={e => handleForm(e)}>
            <TextField label="Email"/>
            <TextField label="Password"/>

            <Button type="submit">
                Register
            </Button>
        </form>
    );
}

export default Register;
